import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { NavLink } from "react-router-dom";
import "../assets/css/nucleo-icons.css";
import "../assets/css/nucleo-svg.css";
import $ from "jquery";
import "../assets/css/textanimate.css";
import { Button } from "reactstrap";
import "../assets/css/argon-dashboard.css?v=2.0.4";
function Transactions() {
  const images = importAll(
    require.context("../assets/img/", false, /\.(png|jpe?g|svg)$/)
  );
  function importAll(r) {
    let images = {};
    r.keys().map((item, index) => {
      images[item.replace("./", "")] = r(item);
    });
    return images;
  }

  const [getbooking, setBooking] = useState([]);
  const [getmembership, setMembership] = useState([]);
  const [getwallet, setWallet] = useState([]);
  const [getwithdraw, setWithdraw] = useState([]);

  const Navigate = useNavigate();

  const booking = async () => {
    const res = await fetch("http://localhost:1337/transactions/booking", {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
      },
    });

    const data = await res.json();
    console.log(data);

    if (res.status === 422 || !data) {
      console.log("error ");
    } else {
      setBooking(data);
      console.log("get data");
    }
  };

  const membership = async () => {
    const res = await fetch("http://localhost:1337/transactions/membership", {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
      },
    });

    const data = await res.json();
    console.log(data);

    if (res.status === 422 || !data) {
      console.log("error ");
    } else {
      setMembership(data);
      console.log("get data");
    }
  };

  const wallet = async () => {
    const res = await fetch("http://localhost:1337/transactions/wallets", {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
      },
    });

    const data = await res.json();
    console.log(data);

    if (res.status === 422 || !data) {
      console.log("error ");
    } else {
      setWallet(data);
      console.log("get data");
    }
  };

  const withdraw = async () => {
    const res = await fetch("http://localhost:1337/transactions/withdraw", {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
      },
    });

    const data = await res.json();
    console.log(data);

    if (res.status === 422 || !data) {
      console.log("error ");
    } else {
      setWithdraw(data);
      console.log("get data");
    }
  };

  function redirect() {
    Navigate("/");
  }
  const styles = {
    btn_group_button: {
      color: "white",
      padding: "10px 24px",
      cursor: "pointer",
      float: "left",
      marginLeft: "452px",
    },
    btn_group_after: {
      content: '""',
      clear: "both",
      display: "table",
    },
    btn_group_button_not__last_child: {
      borderRight: "none",
    },
    btn_group_button_hover: {
      backgroundColor: "#3e8e41",
    },
  };
  $(function () {
    $("#content").hide();
